import React, { useEffect, useState, useRef }  from "react";
import TitleBar from "../components/TitleBar";

const LogContainer = ({ baseUrl }) => {
    const [dives, setDives] = useState([]);

    useEffect(() => {
      loadDives(`${baseUrl}/dives`);
    },[])

    const loadDives = url => {
      fetch(url)
        .then(res => res.json())
        .then(divesList => setDives(divesList))
        .catch(err => console.error(err));
    }

    // Map round divesList, create an array of Dive components
    const mappedDives = divesList.map(dive => {
        return(
            <div className="dive" key={dive.id}>
                    <div>
                        <h4><b>{dive.diveNum}</b></h4> 
                        <p>{dive.place}</p> 
                    </div>
            </div>
        )
    })

    return (
      <>
        {/* Display dive components */}
      </>
    );
  }

  export default LogContainer;
